import React from 'react';

const RegistrationTable = ({ data = [] }) => {
  // Define the number of rows to display
  const totalRows = 10;

  // Create the rows for the table
  const rows = data.length > 0 ? data.slice(0, totalRows) : [];

  // Fill the remaining rows with empty entries if needed
  const emptyRows = totalRows - rows.length;

  return (
    <div>
      <h2>Registration Data</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse', tableLayout: 'fixed' }}>
        <thead>
          <tr>
            {/* Define 10 columns for the table */}
            <th style={{ border: '1px solid black', padding: '8px' }}>Room</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Sector</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Fee Per Month</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Food Choice</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Stay From</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Duration</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Course</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Registration No</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>First Name</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Last Name</th>
          </tr>
        </thead>
        <tbody>
          {rows.map((item, index) => (
            <tr key={index}>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.room}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.sector}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.feePerMonth}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.foodChoice}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.stayFrom}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.duration}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.course}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.registrationNo}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.firstName}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{item.lastName}</td>
            </tr>
          ))}
          {/* Fill empty rows if data length is less than totalRows */}
          {emptyRows > 0 && (
            Array.from({ length: emptyRows }, (_, index) => (
              <tr key={`empty-row-${index}`}>
                <td colSpan="10" style={{ border: '1px solid black', padding: '8px', textAlign: 'center' }}>&nbsp;</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default RegistrationTable;
